'use strict';
class PdasTransportMessage {
    xmlBody;
    url;
    type;
    getXmlBody() {
        return this.xmlBody;
    }
    getUrl() {
        return this.url;
    }
    getType() {
        return this.type;
    }
    static create(type, url, xmlBody) {
        let instance;
        instance = new PdasTransportMessage();
        instance.type = type;
        instance.url = url;
        instance.xmlBody = xmlBody;
        return instance;
    }
}
module.exports = PdasTransportMessage
